import { red } from "@material-ui/core/colors";

const styles = {
  teacherListContainer: {
    maxWidth: "20%"
  },
  teacherList: {
    display: "flex",
    justifyContent: "flex-start",
    listStyle: "none"
  },
  listItem: {
    marginRight: "1rem"
  },
  listItemRed: {
    marginRight: "1rem",
    color: "red"
  }
};
export default styles;
